export default function SeatMap({ seats }) {
  console.log("SEATS LENGTH:", seats.length, seats);

  return (
    <>
      <h2>Seat Map</h2>
      <div className="seat-grid">
        {seats.map((s) => (
          <div
            key={s.id}
            className={`seat ${s.is_booked ? "booked" : "free"}`}
          >
            {s.seat_number}
          </div>
        ))}
      </div>
    </>
  );
}
